export async function handleActivity(channel, msg) {
    if (!msg) {
        console.log('Received null message');
        return;
    }

export async function connect() {
    if (connection) {
        return connection;
    }

export async function createChannel() {
    if (!connection) {
        throw new Error('Connection not established');
    }

export async function disconnect() {
    try {
        if (channel) {
            await channel.close();
            channel = null;
            console.log('Channel closed');
        }

export function getChannel() {
    return channel;
}

export async function startConsumer() {
    try {
        const connection = await connect();
        const channel = await createChannel();
        await assertQueue();
        channel.consume(RABBITMQ_CONFIG.queue, async (msg) => handleActivity(channel, msg));
        console.log('Consumer started successfully');
    }

export async function stopConsumer() {
    await disconnect();
    console.log('Consumer stopped successfully');
}

export async function assertQueue() {
    const channel = getChannel();
    if (!channel) {
        throw new Error('Channel not established');
    }

export async function ackMessage(channel, msg) {
    try {
        channel.ack(msg);
        console.log('Message acknowledged');
    }

